    private String updatehtmltags(){
        String currentText = txtCart.getText();

        // Check if there is existing HTML content
        if (currentText.startsWith("<html>") && currentText.endsWith("</html>")) {
            // Remove the closing </html> tag to append new content
            currentText = currentText.substring(0, currentText.length() - 7);
        } else {
            // If there is no existing HTML content, start the HTML tag
            currentText = "<html>";
        }
        return currentText;
    }
    
